            {item?.quiz&& item.quiz.map((quiz,index)=>{
              return (
                <Title>Quiz no {index+1} :  
                  <Button onPress={               
              ()=>this.downloadQuiz(item)}> Download </Button>
                 </Title>
              )
            })}
          {/* <Paragraph>Time & Date</Paragraph> */}
        </Card.Content>
        {/* <Card.Cover source={{ uri: "https://picsum.photos/700" }} /> */}
        {/* <Card.Actions>
          {item?.quiz&&
          <Button onPress={
             ()=>this.enroll(item)}>Upload </Button>
          }
        </Card.Actions> */}
      </Card>
   
     <View style={styles.container}>
     <Text style={styles.htext}>Student Profile Details</Text>

     <Text >student name: {name} </Text>
     <Text >interested for the subject : {subject} </Text>
     <Text >your class level : {level} </Text>
     <Text >your contact number : {contactNumber} </Text>

     <Text  style={styles.student} >Tutor will be teaching</Text>
     <Text >Tutor name:</Text>
     <Text >Tutor interested for the subject:</Text>
     <Text >Tutor teaching experience:</Text>
     
     </View>
     </ScrollView>
   )

  }
}


const mapStatetoProps = state => {
  console.log({ state });
  return {
    user: state.authReducer.user,
    isAuthenticated: state.authReducer.isAuthenticated
  };
};
export default connect(mapStatetoProps)(StudentProfile);

const styles = StyleSheet.create({
